import React from "react";

const Header: React.FC = () => {
  return (
    <header className="fixed top-0 left-0 w-full bg-white/10 backdrop-blur-md z-50 shadow-md">
      <div className="max-w-7xl mx-auto px-4 py-3 flex justify-between items-center">
        <h1 className="text-2xl font-bold text-indigo-400">Ekarit Visa Service</h1>
        <nav className="space-x-6 text-white/90">
          <a href="#services" className="hover:text-indigo-300">Services</a>
          <a href="#about" className="hover:text-indigo-300">About</a>
          <a href="#contact" className="hover:text-indigo-300">Contact</a>
        </nav>
      </div>
    </header>
  );
};

export default Header;
